define({"topics" : [{"title":"StreamSets Accounts","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_nqf_ls3_glb","attributes": {"data-id":"concept_nqf_ls3_glb",},"menu": {"hasChildren":false,},"tocID":"concept_nqf_ls3_glb-d46e193637","topics":[]},{"title":"Providing an Activation Code","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#unique_912719145","attributes": {"data-id":"unique_912719145",},"menu": {"hasChildren":false,},"tocID":"unique_912719145-d46e193661","topics":[]},{"title":"Viewing Data Collector Configuration Properties","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#task_jyk_vgk_br","attributes": {"data-id":"task_jyk_vgk_br",},"menu": {"hasChildren":false,},"tocID":"task_jyk_vgk_br-d46e193693","topics":[]},{"title":"Viewing Data Collector Directories","shortdesc":"\n            <p class=\"shortdesc\">You can view the directories that the <span class=\"ph\">Data Collector</span> uses. You might   check the directories being used to access a file in the directory or to increase the amount of   available\n               space for a directory. \n            </p>\n         ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_gwn_wf4_yr","attributes": {"data-id":"concept_gwn_wf4_yr",},"menu": {"hasChildren":false,},"tocID":"concept_gwn_wf4_yr-d46e193735","topics":[]},{"title":"Viewing Data Collector Metrics","shortdesc":"\n            <p class=\"shortdesc\">You can view metrics about <span class=\"ph\">Data Collector</span>,  such         as the CPU usage or the number of pipeline runners in the thread pool.\n            </p>\n         ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#task_wvx_4hk_br","attributes": {"data-id":"task_wvx_4hk_br",},"menu": {"hasChildren":false,},"tocID":"task_wvx_4hk_br-d46e193793","topics":[]},{"title":"Viewing Data Collector Logs","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#task_gbm_s3k_br","attributes": {"data-id":"task_gbm_s3k_br",},"menu": {"hasChildren":true,},"tocID":"task_gbm_s3k_br-d46e193862","next":"task_gbm_s3k_br-d46e193862",},{"title":"Shutting Down Data Collector","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#task_uvg_bjk_br","attributes": {"data-id":"task_uvg_bjk_br",},"menu": {"hasChildren":false,},"tocID":"task_uvg_bjk_br-d46e194119","topics":[]},{"title":"Restarting Data Collector","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#task_pjr_5h4_4v","attributes": {"data-id":"task_pjr_5h4_4v",},"menu": {"hasChildren":false,},"tocID":"task_pjr_5h4_4v-d46e194222","topics":[]},{"title":"Viewing Users and Groups","shortdesc":"\n            <p class=\"shortdesc\">If you use file-based authentication, you can view all user accounts granted access         to this <span class=\"ph\">Data Collector</span> instance, including the roles and groups assigned to each user.\n            </p>\n         ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_lxg_qlr_my","attributes": {"data-id":"concept_lxg_qlr_my",},"menu": {"hasChildren":false,},"tocID":"concept_lxg_qlr_my-d46e194335","topics":[]},{"title":"Opting Out of Usage Statistics Collection","shortdesc":"\n            <p class=\"shortdesc\">You can help to improve <span class=\"ph\">Data Collector</span> by         allowing <span class=\"ph\">StreamSets</span> to         collect usage statistics about <span class=\"ph\">Data Collector</span> system         performance and features that you use. This information helps <span class=\"ph\">StreamSets</span> to         improve product performance and to make product development decisions.\n            </p>\n         ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#task_yhm_fpz_2lb","attributes": {"data-id":"task_yhm_fpz_2lb",},"menu": {"hasChildren":false,},"tocID":"task_yhm_fpz_2lb-d46e194464","topics":[]},{"title":"Support Bundles","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_szj_3mw_xz","attributes": {"data-id":"concept_szj_3mw_xz",},"menu": {"hasChildren":true,},"tocID":"concept_szj_3mw_xz-d46e194613","next":"concept_szj_3mw_xz-d46e194613",},{"title":"REST Response","shortdesc":"\n            <p class=\"shortdesc\">You can view REST response JSON data for different aspects of the <span class=\"ph\">Data Collector</span>, such as     pipeline configuration information or monitoring details. \n            </p>\n         ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_dlh_p15_2r","attributes": {"data-id":"concept_dlh_p15_2r",},"menu": {"hasChildren":true,},"tocID":"concept_dlh_p15_2r-d46e195251","next":"concept_dlh_p15_2r-d46e195251",},{"title":"Command Line Interface","shortdesc":"\n            <p class=\"shortdesc\"><span class=\"ph\">Data Collector</span>     provides a command line interface that includes a basic <code class=\"ph codeph\">cli</code> command. Use the     command to perform some of the same actions that you can complete from the <span class=\"ph\">Data Collector</span> UI. <span class=\"ph\">Data Collector</span> must be     running before you can use the <code class=\"ph codeph\">cli</code> command.\n            </p>\n         ","href":"datacollector\/UserGuide\/Administration\/Administration_title.html#concept_ywx_d5x_pt","attributes": {"data-id":"concept_ywx_d5x_pt",},"menu": {"hasChildren":true,},"tocID":"concept_ywx_d5x_pt-d46e195838","next":"concept_ywx_d5x_pt-d46e195838",}]});